package Collection;

import java.util.*;
public class StackExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Stack<String> s = new Stack<String>();
		s.push("Apple");
		s.push("Banana");
		
		System.out.println(s.pop());
		System.out.println(s.size());
	}

}
